import React from "react";
import { useSelector } from "react-redux";
import { Navigate, Route, Routes } from "react-router-dom";
// import Admin from "./Header/Admin";
import Header from "./Header/Header";
import SigninForm from "./Header/SigninForms/SigninForm";
import SignupForm from "./Header/SigninForms/SignupForm";
import Title from "./Header/Title";
// import User from "./Header/User";

import Main from "./Main/Main";

const App = () => {
  const token = useSelector((state) => state.application.token);
  const role = useSelector((state) => state.application.role);

  if (!token) {
    return (
      <div className="App">
        <Header />
        <Main />
        <Routes>
          <Route path="/login" element={<SigninForm />} />
          <Route path="/logup" element={<SignupForm />} />
          <Route path="/user" element={<Navigate to="/login" replace />} />
          <Route path="/admin" element={<Navigate to="/login" replace />} />
        </Routes>
      </div>
    );
  } else if (role === "admin") {
    return (
      <div className="App">
        <Header />
        <Main />
        <Routes>
          <Route path="/admin" />
          <Route path="/login" element={<Navigate to="/admin" replace />} />
        </Routes>
      </div>
    );
  } else {
    return (
      <div className="App">
        <Header />
        <Main />
        <Routes>
          <Route path="/user" element={<Title />} />
          <Route path="/login" element={<Navigate to="/user" replace />} />
        </Routes>
      </div>
    );
  }
};

export default App;
